import React from 'react';
import JobListing from './JobListing';  // Add this line

function Homepage() {
  function suggestSearch(keyword) {
    document.getElementById('searchInput').value = keyword;
    searchJobs();
  }

  function searchJobs() {
    const searchTerm = document.getElementById('searchInput').value.toLowerCase();
    const jobListings = document.querySelectorAll('.job-listing');

    jobListings.forEach((listing) => {
      const title = listing.dataset.title.toLowerCase();

      if (title.includes(searchTerm)) {
        listing.classList.remove('hidden');
      } else {
        listing.classList.add('hidden');
      }
    });
  }

  return (
    <div>
      <div className="left-section">
        <ul className="list-unstyled">
          <li><a className="text-decoration-none text-white" href="#"><i className="bi bi-house-door"></i> My Jobs</a></li>
          <li><a className="text-decoration-none text-white" href="#"><i className="bi bi-gear"></i> Preferences</a></li>
        </ul>
      </div>

      <div className="right-section">
              <SearchBar onSearch={onSearch} suggestSearch={suggestSearch} />

        <JobListing
          title="Barista"
          logoSrc="/project-info340-group-7/project-draft/assets/apple.png"
          company="District Market UW West Campus"
          location="Seattle, WA"
          pay="$20,000 - $30,000 per year"
          qualifications="High School Diploma"
          posted="yesterday"
          className="job-listing"
        />
      </div>
    </div>
  );
}

export default Homepage;
